import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 58.1-4129 Conspiracies and attempts to commit violations; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-4129.md","filePath":"vacode/58.1-4129.md"}'),i={name:"vacode/58.1-4129.md"},n=o('<h1 id="§-58-1-4129-conspiracies-and-attempts-to-commit-violations-penalty" tabindex="-1">§ 58.1-4129 Conspiracies and attempts to commit violations; penalty. <a class="header-anchor" href="#§-58-1-4129-conspiracies-and-attempts-to-commit-violations-penalty" aria-label="Permalink to &quot;§ 58.1-4129 Conspiracies and attempts to commit violations; penalty.&quot;">​</a></h1><p>A. Any person who conspires, confederates, or combines with another, either within or outside the Commonwealth, to commit a felony prohibited by this chapter is guilty of a Class 6 felony.</p><p>B. Any person who attempts to commit any act prohibited by this article is guilty of a criminal offense and shall be punished as provided in § <a href="/vacode/18.2-26/">18.2-26</a>, <a href="/vacode/18.2-27/">18.2-27</a>, or <a href="/vacode/18.2-28/">18.2-28</a>, as appropriate.</p><p>2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1197" target="_blank" rel="noreferrer">1197</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1248" target="_blank" rel="noreferrer">1248</a>.</p>',4),r=[n];function s(c,p,l,d,m,h){return t(),a("div",null,r)}const v=e(i,[["render",s]]);export{f as __pageData,v as default};
